INSERT INTO `wipapp_version_history` (`ID`, `Version`, `Notes`) VALUES
(1, '4.5.0.0', 'Manitowoc Tool and Manufacturing WIP Application\nVersion: 4.5.0.0\nRelease Date: 1/5/2025\n\nPatch Notes:\n\n1/6/2025 Hotfix - You can no longer have more than 1 instance of the application open at once.\n\nNew Feature - Change Log (You are currently reading it)\n\nBug Fixes and code rework of Personal History.\n\nNew Bug Reporting System - In the Event of an error the application will now upload the error details to the WIP server so I can more easily pinpoint problems with the application.  No need to tell me about errors anymore! Well still do, but I can catch them as well.\n\nTransfer Tab Quantity - You can now input a quantity into the Transfer Tab, doing so will split the quantity between the old location and the location you are moving it to.\n\nNo more having to restart after Adding or Removing New Part Numbers, Locations, Users, exc...\n\nWhen exiting the Multiple entries screen, via the Inventory Tab the main window will now reset like it should.\n\nRenamed the 3 tabs to Inventory, Removal and Transfer Tabs those names just seem to make more sense.\n\nUsed AI to look over all methods in the application and had it rework a lot of the code for better performance.'),
(2, '4.5.0.1', 'Manitowoc Tool and Manufacturing WIP Application\r\nVersion: 4.5.0.1\r\nRelease Date: 1/6/2025\r\n\r\nPatch Notes:\r\n\r\n1/6/2025 Hotfix - You can no longer have more than 1 instance of the application open at once.'),
(3, '4.5.0.2', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\nouicompat\\deflang1033{\\fonttbl{\\f0\\fnil\\fcharset0 Segoe UI;}{\\f1\\fnil\\fcharset2 Symbol;}}\r\n{\\colortbl ;\\red30\\green30\\blue30;}\r\n{\\*\\generator Riched20 10.0.19041}\\viewkind4\\uc1 \r\n\\pard\\cf1\\b\\f0\\fs20 Date:\\b0  01/12/2025\\line\\b Version:\\b0  4.5.0.2\\par\r\n\\par\r\n\\b New Feature: Note Editor (Used for Assembly to add Work Order #s to exsisting Transactions)\\b0\\par\r\nThis method allows users to edit notes for selected items in the Remove tab. It helps users view and update notes related to different parts and operations.\\par\r\n\\par\r\n\\b How to Use (Only usable in the Removal Tab, not the Transaction Tab):\\b0\\par\r\n\r\n\\pard \r\n{\\pntext\\f0 1.\\tab}{\\*\\pn\\pnlvlbody\\pnf0\\pnindent0\\pnstart1\\pndec{\\pntxta.}}\r\n\\fi-360\\li720\\b Select Items:\\b0  Click on the items in the list that you want to edit. You can select multiple items by holding down the Ctrl key while clicking.\\par\r\n{\\pntext\\f0 2.\\tab}\\b Click Edit:\\b0  Click the \"Edit\" button to open the edit window.\\par\r\n{\\pntext\\f0 3.\\tab}\\b Edit Notes:\\b0  In the edit window, you can change the notes for the selected items.\\par\r\n{\\pntext\\f0 4.\\tab}\\b Editing Notes:\\b0  You can edit the notes in the text box. Click the save button to save your changes. If there are more notes, it will show the next one.\\par\r\n{\\pntext\\f0 5.\\tab}\\b Skipping Notes:\\b0  Click the skip button to move to the next note without saving any changes.\\par\r\n{\\pntext\\f0 6.\\tab}\\b Exiting:\\b0  When you are done, click the save button when it says \"Exit\" to close the form.\\par\r\n\r\n\\pard\\b\\par\r\nMinor Changes:\\b0\\par\r\n\r\n\\pard{\\pntext\\f1\\\'B7\\tab}{\\*\\pn\\pnlvlblt\\pnf1\\pnindent0{\\pntxtb\\\'B7}}\\fi-360\\li720 The Change Log window will now only show up when the application starts unless the checkbox is below is checked.\\b\\par\r\n{\\pntext\\f1\\\'B7\\tab}\\b0 \"Don\'t show until next patch\" will now flash red/bold when it is not checked to draw attention to it.\\b\\par\r\n{\\pntext\\f1\\\'B7\\tab}\\b0 Fixed an error in Skipping Notes (Edit Notes) that caused the application to crash when clicking too many times.\\b\\par\r\n{\\pntext\\f1\\\'B7\\tab}\\b0 Added an Image that says \"Nothing Found\" when a search comes up empty.\\b\\par\r\n}\r\n'),
(4, '4.5.0.3', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\nouicompat\\deflang1033{\\fonttbl{\\f0\\fnil\\fcharset0 Segoe UI;}{\\f1\\fnil Segoe UI;}}\r\n{\\*\\generator Riched20 10.0.19041}\\viewkind4\\uc1 \r\n\\pard\\f0\\fs18 Patch Date: 02/02/2025\\par\r\nVersion: 4.5.0.3\\par\r\n\\par\r\nBug Fix: Transfer Tab will now correctly transfer a single item in the event where there are duplicates of that Item.  (Thanks 3rd Shift for finding this bug)\\par\r\n\\par\r\nBug Fix: Fixed Version Checker, this runs in the background and in the event where the application is updated remotly, it will autmatically prompt the user that they are using an outdated version if the application and close the app, allowing for a smoother update experience.\\f1\\par\r\n}\r\n'),
(5, '4.5.1.0', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\nouicompat\\deflang1033{\\fonttbl{\\f0\\fnil\\fcharset0 Segoe UI;}{\\f1\\fnil Segoe UI;}}\r\n{\\*\\generator Riched20 10.0.19041}\\viewkind4\\uc1 \r\n\\pard\\f0\\fs18 Patch Date: 03/19/2025\\par\r\nVersion: 4.5.1.0\\par\r\n\\par\r\nBug Fix: Bug where some users could not open app even though its not open, should hopefully be resolved now.\\par\r\n\\par\r\nBug Fix: Added User Based Logging: Each user has there own folder stored in the Expo Drive that has detailed information about each time they use the app.  Will be handy for future bug fixes.\\f1\\par\r\n}\r\n'),
(6, '4.6.0.0', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\nouicompat\\deflang1033{\\fonttbl{\\f0\\fnil\\fcharset0 Segoe UI;}{\\f1\\fnil Segoe UI;}{\\f2\\fnil\\fcharset2 Symbol;}}\r\n{\\colortbl ;\\red30\\green30\\blue30;\\red0\\green108\\blue190;}\r\n{\\*\\listtable \r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx720}\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'01.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx360}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid1 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid2 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx1440}\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'01.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx360}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid3 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid4 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx1440}\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'01.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx360}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid5 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx720}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid6 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx1440}\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'01.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx360}\\listid7 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'00.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx720}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid8 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'00.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx360}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid9 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'00.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx1440}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid10 }\r\n{\\list\\listhybrid\r\n{\\listlevel\\levelnfc0\\leveljc0\\levelstartat1{\\leveltext\\\'02\\\'00.;}{\\levelnumbers\\\'01;}\\jclisttab\\tx360}\r\n{\\listlevel\\levelnfc23\\leveljc0\\levelstartat1{\\leveltext\\\'01\\\'B7;}{\\levelnumbers;}\\f2\\jclisttab\\tx360}\\listid11 }}\r\n{\\*\\listoverridetable{\\listoverride\\listid1\\listoverridecount0\\ls1}{\\listoverride\\listid2\\listoverridecount0\\ls2}{\\listoverride\\listid3\\listoverridecount0\\ls3}{\\listoverride\\listid4\\listoverridecount0\\ls4}{\\listoverride\\listid5\\listoverridecount0\\ls5}{\\listoverride\\listid6\\listoverridecount0\\ls6}{\\listoverride\\listid7\\listoverridecount0\\ls7}{\\listoverride\\listid8\\listoverridecount0\\ls8}{\\listoverride\\listid9\\listoverridecount0\\ls9}{\\listoverride\\listid10\\listoverridecount0\\ls10}{\\listoverride\\listid11\\listoverridecount0\\ls11}}\r\n{\\*\\generator Riched20 10.0.19041}\\viewkind4\\uc1 \r\n\\pard\\cf1\\b\\f0\\fs27 Changelog for MTM WIP App\\par\r\n\\fs18 Version:\\b0  4.6.0.0\\line\\b Date:\\b0  05/04/2025\\par\r\n---\\par\r\n\\b\\fs27 New Features\\par\r\n\\ul Unified Entry Form\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx720\\ls1\\fi-360\\li720\\sb150\\sa150\\ulnone\\b\\fs18 Purpose:\\b0\\line The \\cf2\\ul\\fs20 UnifiedEntryForm\\cf1\\ulnone\\fs18  is designed to streamline the process of adding new objects (e.g., Users, Parts, Part Types, Operations, and Locations) to the database. It consolidates multiple forms into a single, dynamic interface that adjusts based on the selected object type.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls1\\fi-360\\li720\\sb150\\sa150\\b Key Features:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 1.\\tab}\\jclisttab\\tx360\\ls1\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b Dynamic Panel Resizing:\\b0\\line The form dynamically adjusts its layout to display only the fields relevant to the selected object type.\\par\r\n{\\listtext\\f0 2.\\tab}\\b Single and Multiple Location Entry:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls1\\ilvl2\\fi-360\\li2160\\sb150\\sa150\\b Single Location Mode:\\b0  Allows users to input a single location.\\par\r\n{\\listtext\\f0 1\\tab}\\b Multiple Location Mode:\\b0  Enables users to define a range of locations by specifying zone, sub-zone, height, and column ranges. The form generates all locations within the range and saves them to the database.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 3.\\tab}\\jclisttab\\tx360\\ls1\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b Validation:\\b0\\line Ensures all required fields are filled out correctly before saving. Displays clear error messages for invalid inputs.\\par\r\n{\\listtext\\f0 4.\\tab}\\b Integration with LoginPromptForm:\\b0\\line When accessed from the \\cf2\\ul\\fs20 LoginPromptForm\\cf1\\ulnone\\fs18 , the form is pre-configured to add a new user and return the details for immediate login.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls2\\fi-360\\li720\\sb150\\sa150\\b How to Access:\\b0\\line Navigate to the \\b Edit\\b0  menu in the \\cf2\\ul\\fs20 MainForm\\cf1\\ulnone\\fs18  menu bar.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls2\\ilvl1\\fi-360\\li1440\\sb150\\sa150 Select \\b New Object\\b0  to open the \\cf2\\ul\\fs20 UnifiedEntryForm\\cf1\\ulnone\\fs18 .\\par\r\n\r\n\\pard ---\\par\r\n\\ul\\b\\fs27 Unified Removal Form\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx1440\\ls3\\fi-360\\li720\\sb150\\sa150\\ulnone\\b\\fs18 Purpose:\\b0\\line The \\cf2\\ul\\fs20 UnifiedRemovalForm\\cf1\\ulnone\\fs18  simplifies the process of removing objects (e.g., Users, Parts, Part Types, Operations, and Locations) from the database. It provides a unified interface for managing deletions.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls3\\fi-360\\li720\\sb150\\sa150\\b Key Features:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 1.\\tab}\\jclisttab\\tx360\\ls3\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b DataGridView Integration:\\b0\\line Displays data in a grid for easy selection and deletion. Supports multi-selection for batch deletions.\\par\r\n{\\listtext\\f0 2.\\tab}\\b Special Handling for User Deletions:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls3\\ilvl2\\fi-360\\li2160\\sb150\\sa150 Removes users from related tables (\\b leads\\b0 , \\b readonly\\b0 , and \\cf2\\ul\\fs20 mysql.user\\cf1\\ulnone\\fs18 ) before deleting them from the main \\b users\\b0  table.\\par\r\n{\\listtext\\f0 1\\tab}Prevents deletion of the first row and the currently logged-in user.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 3.\\tab}\\jclisttab\\tx360\\ls3\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b Confirmation and Feedback:\\b0\\line Prompts the user for confirmation before deletion and displays success messages after completion.\\par\r\n{\\listtext\\f0 4.\\tab}\\b Error Handling:\\b0\\line Provides detailed error messages for any issues encountered during the deletion process.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls4\\fi-360\\li720\\sb150\\sa150\\b How to Access:\\b0\\line Navigate to the \\b Edit\\b0  menu in the \\cf2\\ul\\fs20 MainForm\\cf1\\ulnone\\fs18  menu bar.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls4\\ilvl1\\fi-360\\li1440\\sb150\\sa150 Select \\b Remove Object\\b0  to open the \\cf2\\ul\\fs20 UnifiedRemovalForm\\cf1\\ulnone\\fs18 .\\par\r\n\r\n\\pard ---\\par\r\n\\ul\\b\\fs27 ForceCloseForm\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx1440\\ls5\\fi-360\\li720\\sb150\\sa150\\ulnone\\b\\fs18 Purpose:\\b0\\line The \\cf2\\ul\\fs20 ForceCloseForm\\cf1\\ulnone\\fs18  allows administrators to terminate processes running on local or remote machines. It provides a user-friendly interface for selecting users, viewing hostnames, and specifying processes to terminate.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls5\\fi-360\\li720\\sb150\\sa150\\b Key Features:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 1.\\tab}\\jclisttab\\tx360\\ls5\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b User and Hostname Selection:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls5\\ilvl2\\fi-360\\li2160\\sb150\\sa150 Displays a list of active users and their associated hostnames.\\par\r\n{\\listtext\\f0 1\\tab}Automatically populates the hostname field when a user is selected.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 2.\\tab}\\jclisttab\\tx360\\ls5\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b Process Name Handling:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls5\\ilvl2\\fi-360\\li2160\\sb150\\sa150 Automatically pre-fills the process name field with the current application\'s process name.\\par\r\n{\\listtext\\f0 1\\tab}Replaces underscores (\\b _\\b0 ) in process names with spaces for better readability.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 3.\\tab}\\jclisttab\\tx360\\ls5\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b Local and Remote Process Termination:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls5\\ilvl2\\fi-360\\li2160\\sb150\\sa150\\b Local Processes:\\b0  Terminates processes running on the local machine.\\par\r\n{\\listtext\\f0 1\\tab}\\b Remote Processes:\\b0  Connects to remote machines using administrator credentials to terminate processes.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 4.\\tab}\\jclisttab\\tx360\\ls5\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b Error Handling and Feedback:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls5\\ilvl2\\fi-360\\li2160\\sb150\\sa150 Provides detailed error messages for connection issues, permission errors, or invalid inputs.\\par\r\n{\\listtext\\f0 1\\tab}Displays success messages upon successful termination of processes.\\par\r\n\r\n\\pard{\\pntext\\f2\\\'B7\\tab}{\\*\\pn\\pnlvlblt\\pnf2\\pnindent360{\\pntxtb\\\'B7}}\\fi-360\\li720\\sb150\\sa150\\b How to Access:\\b0\\line Open the \\cf2\\ul\\fs20 ForceCloseForm\\cf1\\ulnone\\fs18  from the \\b Tools\\b0  menu in the \\cf2\\ul\\fs20 MainForm\\cf1\\ulnone\\fs18 .\\par\r\n\r\n\\pard ---\\par\r\n\\b\\fs27 Enhancements\\par\r\n\\ul Dynamic Panel Resizing in Unified Entry Form\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx720\\ls6\\fi-360\\li720\\sb150\\sa150\\ulnone\\b\\fs18 What It Does:\\b0\\line Automatically adjusts the form\'s height based on the selected object type, ensuring only relevant fields are displayed.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls6\\fi-360\\li720\\sb150\\sa150\\b How to Access:\\b0\\line Open the \\cf2\\ul\\fs20 UnifiedEntryForm\\cf1\\ulnone\\fs18  via \\b Edit > New Object\\b0 .\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls6\\ilvl1\\fi-360\\li1440\\sb150\\sa150 Select an object type from the dropdown menu to see the form dynamically resize.\\par\r\n\r\n\\pard ---\\par\r\n\\ul\\b\\fs27 VersionChecker Execution on Startup\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx1440\\ls7\\fi-360\\li720\\sb150\\sa150\\ulnone\\b\\fs18 Purpose:\\b0\\line The \\cf2\\ul\\fs20 VersionChecker\\cf1\\ulnone\\fs18  method ensures that the application version matches the version stored in the database. It validates the version on startup and periodically every 30 seconds to ensure consistency throughout the application\'s lifecycle.\\par\r\n\r\n\\pard \r\n{\\listtext\\f0\\u10625?\\tab}\\jclisttab\\tx360\\ls7\\fi-360\\li720\\sb150\\sa150\\b Key Features:\\b0\\par\r\n\r\n\\pard \r\n{\\listtext\\f0 1.\\tab}\\jclisttab\\tx360\\ls7\\ilvl1\\fi-360\\li1440\\sb150\\sa150\\b Immediate Validation:\\b0\\line The \\cf2\\ul\\fs20 VersionChecker\\cf1\\ulnone\\fs18  runs immediately upon application startup to detect any version mismatches before the main application window is displayed.\\par\r\n{\\listtext\\f0 2.\\tab}\\b Periodic Validation:\\b0\\line The method continues to run every 30 seconds via a timer to ensure the application remains in sync with the database version.\\par\r\n{\\listtext\\f0 3.\\tab}\\b User Notification:\\b0\\line If a version mismatch is detected, the user is notified with a warning message. The application will close in 30 seconds unless the user confirms the warning.\\par\r\n{\\listtext\\f0 4.\\tab}\\b Error Handling:\\b0\\line The method includes robust error handling to log database connection issues and notify the user of any unexpected errors.\\par\r\n\r\n\\pard{\\pntext\\f2\\\'B7\\tab}{\\*\\pn\\pnl